import { useRouter } from 'next/router'
import AdminLayout from "../components/AdminLayout";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import {Paper, TextField} from "@material-ui/core";
import Avatar from "@material-ui/core/Avatar";


export default function Profile() {
    const router = useRouter()
    const [userId, setUserId] = useState("");
    const [nMode, setNMode] = useState(true);

    return (
        <AdminLayout setNMode={setNMode} setUserId={setUserId}>
            <Typography variant="h5" gutterBottom style={{color: "grey", marginTop:15}}>
                Profile
            </Typography>

            {/* <Grid item xs={2} style={{justifyItems:"flex-end", justifyContent:"flex-end", backgroundColor:"", borderRadius:10}}> */}
                <Grid item xs={10} >
                    <Paper style={{backgroundColor:"", padding:20, color:"#fff"}}>
                    <Avatar alt="Super Admin" src={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSGvQLQ8CE9JyN11FHwSx4McRKThU-tc1pk_A&usqp=CAU"} style={{width:400, height:400}}></Avatar>
                    {/* <Avatar alt="Profile Pic" src={"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSGvQLQ8CE9JyN11FHwSx4McRKThU-tc1pk_A&usqp=CAU"} style={{alignSelf:"center", marginBottom:20, marginTop:10, marginLeft:"auto", marginRight:"auto", width:45, height:45}}/> */}
                        <Grid container>
                            <Grid item xs={6}>
                                <Typography variant="body2" component="h2" style={{textAlign:"right"}}>
                                    Wins
                                </Typography>
                                
                            </Grid>
                        </Grid>
                    </Paper>
                </Grid>
                {/* </Grid> */}
        </AdminLayout>
    )
}
